import React from 'react';
import { makeStyles, useTheme } from '@material-ui/core/styles';
import CurrentDayLoadItem  from '../loads/CurrentDayLoadItem.js';
import Card from '@material-ui/core/Card';
import CardContent from '@material-ui/core/CardContent';
import CardMedia from '@material-ui/core/CardMedia';
import IconButton from '@material-ui/core/IconButton';
import Typography from '@material-ui/core/Typography';
import SkipPreviousIcon from '@material-ui/icons/SkipPrevious';
import PlayArrowIcon from '@material-ui/icons/PlayArrow';
import SkipNextIcon from '@material-ui/icons/SkipNext';
import ArrowForwardRoundedIcon from '@material-ui/icons/ArrowForwardRounded';


import theme from "../layout/ui/Theme";

const useStyles = makeStyles((theme) => ({

  root: {
   display: 'flex',
   minWidth: 300
 },
 details: {
   display: 'flex',
   flexDirection: 'column',
 },
 content: {
   flex: '1 0 auto',
 },
 controls: {
   display: 'flex',
   alignItems: 'center',
   paddingLeft: theme.spacing(1),
   paddingBottom: theme.spacing(1),
 },
 pickup: {
   fontSize: 14,
 },
 p: {
   margin:0,
   padding:0
 },
 playIcon: {
   height: 38,
   width: 30,
   marginLeft: 0
 },

}));


export const Loadcard = props => {
  const classes = useStyles();
  const theme = useTheme();


  return (
    <Card zeroMinWidth className={classes.root}>
      <div className={classes.details}>
        <div className={classes.controls}>
        <CardContent className={classes.content}>
         <Typography className={classes.pickup}>
         <p className={classes.p}>Pickup</p>
         <p className={classes.p}>Plainfield, IN</p>
         <p className={classes.p}>0800 EST</p>
         <p className={classes.p}>3/11</p>
         </Typography >
          </CardContent>
          <Typography className={classes.pickup}>
          <p className={classes.p}>2664578</p>
          <IconButton><ArrowForwardRoundedIcon className={classes.playIcon} /></IconButton>
          <p className={classes.p}>Johnson</p>
          </Typography>
          <CardContent className={classes.content}>
          <Typography className={classes.pickup}>
            <p className={classes.p}>Drop</p>
            <p className={classes.p}>Zanesville, OH</p>
            <p className={classes.p}>1200 EST</p>
            <p className={classes.p}>3/11</p>
          </Typography>
          </CardContent>
        </div>
      </div>
    </Card>
  );
}
